/*View structure for view bi_item_in_out */

/*!50001 DROP TABLE IF EXISTS `bi_item_in_out` */;
/*!50001 DROP VIEW IF EXISTS `bi_item_in_out` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `bi_item_in_out` AS (select `i`.`itemInId` AS `InOutId`,`i`.`dateIn` AS `Fecha`,`li`.`itemInLineId` AS `InOutLineId`,`li`.`itemId` AS `itemId`,`li`.`quantity` AS `Cantidad` from (`item_in` `i` join `item_in_line` `li` on((`li`.`itemInId` = `i`.`itemInId`)))) union all (select -(`o`.`itemOutId`) AS `InOutId`,`o`.`dateOut` AS `Fecha`,-(`lo`.`itemOutLineId`) AS `InOutLineId`,`lo`.`itemId` AS `itemId`,-(`lo`.`quantity`) AS `Cantidad` from (`item_out` `o` join `item_out_line` `lo` on((`lo`.`itemOutId` = `o`.`itemOutId`)))) union all (select 0 AS `InOutId`,min(`s`.`lastInvDate`) AS `Fecha`,0 AS `InOutLineId`,`s`.`itemId` AS `itemId`,min(`s`.`stock`) AS `Cantidad` from `item_stock` `s` group by `s`.`itemId`) */;

/*View structure for view bi_pw */

/*!50001 DROP TABLE IF EXISTS `bi_pw` */;
/*!50001 DROP VIEW IF EXISTS `bi_pw` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `bi_pw` AS select `p`.`pwId` AS `pwId`,`p`.`name` AS `Proyecto`,`p`.`total` AS `Coste_Presupuestado`,((select sum(`l`.`amount`) from `pw_line` `l` where (`l`.`pwId` = `p`.`pwId`)) * ifnull(`p`.`mainK`,1)) AS `Coste_Calculado`,(select sum((`w`.`Cantidad` * `w`.`Coste`)) from `bi_wo` `w` where (`w`.`pwId` = `p`.`pwId`)) AS `Coste_Realizado`,(select `c`.`Coste_Calculado` from `bi_closure` `c` where (`c`.`pwId` = `p`.`pwId`) order by `c`.`Fecha_Cierre` desc limit 1) AS `Coste_Ultimo_Cierre`,`p`.`statusId` AS `statusId`,`p`.`companyId` AS `companyId`,`p`.`zoneId` AS `zoneId`,`p`.`initDate` AS `Fecha_Presupuesto`,`p`.`acepDate` AS `Fecha_Aceptación`,`p`.`finDate` AS `Fecha_Realización`,`p`.`cerDate` AS `Fecha_Certificación`,`p`.`invDate` AS `Fecha_Facturación`,`p`.`payDate` AS `Fecha_Pago`,`p`.`endDate` AS `Fecha_Fin` from `pw` `p` */;

