/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `bi_pw_line` AS select `l`.`pwId` AS `pwId`,`l`.`cunitId` AS `cunitId`,sum(`l`.`quantity`) AS `Proyectadas`,(select sum(`w`.`Cantidad`) from `bi_wo` `w` where ((`w`.`pwId` = `l`.`pwId`) and (`w`.`cunitId` = `l`.`cunitId`))) AS `Realizadas`,sum(`l`.`amount`) AS `Coste` from `pw_line` `l` group by `l`.`pwId`,`l`.`cunitId` */;

